import React from 'react';
import Event from '../components/Event';
import '../stylesheets/events.scss'

const EventsList = ({events}) => {
  renderEvents = () => {
    return events.map((e, i) => {
      return <Event event={e} key={i} />
    })
  }

  return (
    <div id="events-div">
      <h3>Events</h3>
      {this.renderEvents()}
    </div>
  )
}

export default EventsList;
